import{_ as e,o as a,c as i,O as t}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 54.1-3452 Schedule IV.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-3452.md","filePath":"vacode/54.1-3452.md"}'),o={name:"vacode/54.1-3452.md"},p=t('<h1 id="§-54-1-3452-schedule-iv" tabindex="-1">§ 54.1-3452 Schedule IV. <a class="header-anchor" href="#§-54-1-3452-schedule-iv" aria-label="Permalink to &quot;§ 54.1-3452 Schedule IV.&quot;">​</a></h1><p>The controlled substances listed in this section are included in Schedule IV unless specifically excepted or listed in another schedule:</p><ol><li>Any material, compound, mixture, or preparation which contains any quantity of the following substances having a potential for abuse associated with a depressant effect on the central nervous system:</li></ol><p>Alfaxalone (5[alpha]-pregnan-3[alpha]-ol-11, 20-dione), previously spelled &quot;alphaxalone,&quot; including its salts, isomers, and salts of isomers;</p><p>Alprazolam;</p><p>Barbital;</p><p>Brexanolone;</p><p>Bromazepam;</p><p>Camazepam;</p><p>Carisoprodol;</p><p>Chloral betaine;</p><p>Chloral hydrate;</p><p>Chlordiazepoxide;</p><p>Clobazam;</p><p>Clonazepam;</p><p>Clorazepate;</p><p>Clotiazepam;</p><p>Cloxazolam;</p><p>Delorazepam;</p><p>Diazepam;</p><p>Dichloralphenazone;</p><p>Estazolam;</p><p>Ethchlorvynol;</p><p>Ethinamate;</p><p>Ethyl loflazepate;</p><p>Fludiazepam;</p><p>Flunitrazepam;</p><p>Flurazepam;</p><p>Fospropofol;</p><p>Halazepam;</p><p>Haloxazolam;</p><p>Ketazolam;</p><p>Loprazolam;</p><p>Lorazepam;</p><p>Lormetazepam;</p><p>Mebutamate;</p><p>Medazepam;</p><p>Methohexital;</p><p>Meprobamate;</p><p>Methylphenobarbital;</p><p>Midazolam;</p><p>Nimetazepam;</p><p>Nitrazepam;</p><p>Nordiazepam;</p><p>Oxazepam;</p><p>Oxazolam;</p><p>Paraldehyde;</p><p>Petrichloral;</p><p>Phenobarbital;</p><p>Pinazepam;</p><p>Prazepam;</p><p>Quazepam;</p><p>Suvorexant ([(7R)-4-(5-chloro-1,3-benzoxazol-2-yl)-7-methyl-1,4-diazepan-1-yl][5-methyl-2- (2H-1, 2, 3-triazol-2-yl) phenyl]methanone), including its salts, isomers, and salts of isomers;</p><p>Temazepam;</p><p>Tetrazepam;</p><p>Triazolam;</p><p>Zaleplon;</p><p>Zolpidem;</p><p>Zopiclone.</p><ol start="2"><li>Any compound, mixture or preparation which contains any quantity of the following substances including any salts or isomers thereof:</li></ol><p>Fenfluramine;</p><p>Lorcaserin.</p><ol start="3"><li>Unless specifically excepted or unless listed in another schedule, any material, compound, mixture, or preparation which contains any quantity of the following substances having a stimulant effect on the central nervous system, including its salts, isomers (whether optical, position, or geometric), and salts of such isomers whenever the existence of such salts, isomers, and salts of isomers is possible within the specific chemical designation:</li></ol><p>Cathine (+)-norpseudoephedrine;</p><p>Diethylpropion;</p><p>Fencamfamin;</p><p>Fenproprex;</p><p>Mazindol;</p><p>Mefenorex;</p><p>Modafinil;</p><p>Phentermine;</p><p>Pemoline (including organometallic complexes and chelates thereof);</p><p>Pipradrol;</p><p>Sibutramine;</p><p>Solriamfetol (2-amino-3-phenylpropyl carbamate);</p><p>SPA (-)-1-dimethylamino-1,2-diphenylethane.</p><ol start="4"><li>Unless specifically excepted or unless listed in another schedule, any material, compound, mixture, or preparation containing any of the following narcotic drugs, or their salts calculated as the free anhydrous base or alkaloid, in limited quantities as set forth below:</li></ol><p>Dextropropoxyphene (alpha-(+)-4-dimethylamino-1,2-diphenyl-3-methyl-2-propionoxybutane);</p><p>Not more than 1 milligram of difenoxin and not less than 25 micrograms of atropine sulfate per dosage unit;</p><p>2-[(dimethylamino) methyl]-1-(3-methoxyphenyl) cyclohexanol, its salts, optical and geometric isomers, and salts of such isomers, including tramadol.</p><ol start="5"><li>Unless specifically excepted or unless listed in another schedule, any material, compound, mixture, or preparation which contains any quantity of the following substances, including their salts:</li></ol><p>Butorphanol (including its optical isomers);</p><p>Eluxadoline (including its optical isomers and its salts, isomers, and salts of isomers);</p><p>Pentazocine.</p><ol start="6"><li>The Board may except by regulation any compound, mixture, or preparation containing any depressant substance listed in subdivision 1 from the application of all or any part of this chapter if the compound, mixture, or preparation contains one or more active medicinal ingredients not having a depressant effect on the central nervous system, and if the admixtures are included therein in combinations, quantity, proportion, or concentration that vitiate the potential for abuse of the substances which have a depressant effect on the central nervous system.</li></ol><p>1972, c. 798, § 54-524.84:10; 1976, c. 614; 1977, c. 302; 1978, c. 705; 1979, c. 387; 1982, c. 505; 1986, c. 463; 1988, cc. 283, 765; 1992, c. 737; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0763" target="_blank" rel="noreferrer">763</a>; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0105" target="_blank" rel="noreferrer">105</a>; 1999, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0605" target="_blank" rel="noreferrer">605</a>; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0135" target="_blank" rel="noreferrer">135</a>; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0640" target="_blank" rel="noreferrer">640</a>; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0346" target="_blank" rel="noreferrer">346</a>; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0423" target="_blank" rel="noreferrer">423</a>; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0540" target="_blank" rel="noreferrer">540</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0074" target="_blank" rel="noreferrer">74</a>; 2015, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0303" target="_blank" rel="noreferrer">303</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0499" target="_blank" rel="noreferrer">499</a>; 2022, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0114" target="_blank" rel="noreferrer">114</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0115" target="_blank" rel="noreferrer">115</a>.</p>',86),r=[p];function n(l,s,c,h,m,d){return a(),i("div",null,r)}const g=e(o,[["render",n]]);export{f as __pageData,g as default};
